    </script>
<style>
/* Loading背景画面設定　*/

#splash {
    /*fixedで全面に固定*/
	position: fixed;
	z-index: 999;
	width: 100%;
	height: 100%;
	background:#333;
	text-align:center;
	color:#fff;
}

/* Loadingバー中央配置　*/
#splash_text {
	position: absolute;
	top: 50%;
	left: 50%;
    z-index: 999;
	width: 100%;
	transform: translate(-50%, -50%);
	color: #fff;
}

/*IE11対策用バーの線の高さ※対応しなければ削除してください*/
#splash_text svg{
    height: 2px;
}

      body {
        margin: 0;
        padding: 0;
        overflow: hidden;
      }
      #video {
        position: absolute;
        top: 0;
        left: 0;
        width: 100vw;
        height: 100vh;
        object-fit: cover;
      }
      #snap {
        position: absolute;
        top: 10px;
        left: 10px;
        z-index: 1;
      }
      #save {
        position: absolute;
        top: 10px;
        right: 10px;
        z-index: 1;
      }
      #switch {
        position: absolute;
        bottom: 10px;
        left: 50%;
        transform: translateX(-50%);
        z-index: 1;
      }
      #canvas {
        display: none;
      }
    </style>
  </head>
  <body>

<div id="splash">
<div id="splash_text"></div>
<!--/splash--></div>
<div id="container">

    <h1>カメラアプリ</h1>
    <video id="video" width="3264" height="2448" autoplay></video>
    <button id="snap">撮影</button>
    <button id="save">保存</button>
    <button id="switch">カメラ切替</button>
    <canvas id="canvas" width="3264" height="2448"></canvas>
    <script>
      const video = document.getElementById('video');
      const canvas = document.getElementById('canvas');
      const snap = document.getElementById('snap');
      const save = document.getElementById('save');
      const switchBtn = document.getElementById('switch');
      let photos = [];
      let currentFacingMode = 'environment';

      function startCamera() {
        const constraints = {
          video: {
            width: { ideal: 3264 },
            height: { ideal: 2448 },
            facingMode: currentFacingMode
          }
        };

        navigator.mediaDevices.getUserMedia(constraints)
          .then(stream => {
            video.srcObject = stream;
            video.play();
          })
          .catch(err => {
            console.error('Error accessing camera', err);
          });
      }

      function switchCamera() {
        currentFacingMode = currentFacingMode === 'environment' ? 'user' : 'environment';
        video.pause();
        video.srcObject.getTracks().forEach(track => track.stop());
        startCamera();
      }

      startCamera();

      snap.addEventListener('click', () => {
        canvas.getContext('2d').drawImage(video, 0, 0, canvas.width, canvas.height);
        photos.push(canvas.toDataURL('image/png'));
      });

      save.addEventListener('click', () => {
        if (photos.length > 0) {
          const zip = new JSZip();
          photos.forEach((photo, index) => {
            const filename = `photo${index}.png`;
            zip.file(filename, photo.substr(photo.indexOf(',') + 1), {base64: true});
          });
          zip.generateAsync({type:"blob"}).then(content => {
            const link = document.createElement('a');
            link.download = 'photos.zip';
            link.href = window.URL.createObjectURL(content);
            link.click();
          });
        }
      });

      switchBtn.addEventListener('click', () => {
        switchCamera();
      });
    </script>
<!--/container--></div>
      <script>
          var bar = new ProgressBar.Line(splash_text, {//id名を指定
	easing: 'easeInOut',//アニメーション効果linear、easeIn、easeOut、easeInOutが指定可能
	duration: 3000,//時間指定(1000＝1秒)
	strokeWidth: 0.2,//進捗ゲージの太さ
	color: '#555',//進捗ゲージのカラー
	trailWidth: 0.2,//ゲージベースの線の太さ
	trailColor: '#bbb',//ゲージベースの線のカラー
	text: {//テキストの形状を直接指定				
		style: {//天地中央に配置
			position: 'absolute',
			left: '50%',
			top: '50%',
			padding: '0',
			margin: '-30px 0 0 0',//バーより上に配置
			transform:'translate(-50%,-50%)',
			'font-size':'1rem',
			color: '#fff',
		},
		autoStyleContainer: false //自動付与のスタイルを切る
	},
	step: function(state, bar) {
		bar.setText(Math.round(bar.value() * 100) + ' %'); //テキストの数値
	}
});

//アニメーションスタート
bar.animate(1.0, function () {//バーを描画する割合を指定します 1.0 なら100%まで描画します
	$("#splash").delay(500).fadeOut(800);//アニメーションが終わったら#splashエリアをフェードアウト
});  
      </script>
  </body>
</html>
